import React, { useState } from "react";
import { useNavigate, Link } from "react-router-dom";
import {
  Container,
  Typography,
  Card,
  CardContent,
  Button,
  IconButton,
  List,
  ListItem,
  ListItemText,
  Box,
  Divider
} from '@mui/material';
import {
  Menu as MenuIcon,
  ExitToApp as ExitToAppIcon,
  AccountBalanceWallet as AccountBalanceWalletIcon,
  Group as GroupIcon,
  GroupAdd as GroupAddIcon,
  AccountCircle as AccountCircleIcon,
  Rule as RuleIcon,
  HelpOutline as HelpOutlineIcon,
  Security as SecurityIcon,
  Assignment as AssignmentIcon
} from '@mui/icons-material';
import FooterMenu from '../Footer.jsx';
import './Quantity.css';

const QuantitativeTrading = () => {
  const navigate = useNavigate();
  const [menuOpen, setMenuOpen] = useState(false);

  const toggleMenu = () => setMenuOpen(!menuOpen);
  const logout = () => {
    // Add logout logic here
  };

  return (
    <div className="general-container">
      {/* Header */}
      <div className={`general-content ${menuOpen ? 'expanded' : ''}`}>
        <div className="header">
          <div className="header-left">
            <IconButton onClick={toggleMenu}>
              <MenuIcon />
            </IconButton>
          </div>
          <div className="header-right">
            <button className="logout-btn" onClick={logout}>
              <ExitToAppIcon /> Logout
            </button>
          </div>
        </div>
      </div>

      {/* Side Menu */}
      <div className={`side-menu ${menuOpen ? 'open' : ''}`}>
        <List>
          {[
            { text: 'Company Profile', icon: <AccountCircleIcon />, path: '/company-profile' },
            { text: 'Platform Rules', icon: <RuleIcon />, path: '/platform-rules' },
            { text: 'Common Problems', icon: <HelpOutlineIcon />, path: '/common-problems' },
            { text: 'Security Center', icon: <SecurityIcon />, path: '/security-center' },
            { text: 'Funding Details', icon: <AccountBalanceWalletIcon />, path: '/funding-details' },
            { text: 'Invite Friends', icon: <GroupAddIcon />, path: '/invite-friends' },
            { text: 'My Team', icon: <GroupIcon />, path: '/my-team' },
            { text: 'Quotation Tutorial', icon: <AssignmentIcon />, path: '/quotation-tutorial' }
          ].map((item, index) => (
            <ListItem button key={index} component={Link} to={item.path} className="menu-item">
              {item.icon}
              <ListItemText primary={item.text} />
            </ListItem>
          ))}
        </List>
      </div>

      {/* Main Content */}
      <div className={`general-content ${menuOpen ? 'expanded' : ''}`}>
        <Card className="general-card" sx={{ boxShadow: 3 }}>
          <CardContent>
            <Typography variant="h4" align="center" sx={{ mb: 3 }}>
              Quantitative Trading
            </Typography>
            <Divider sx={{ mb: 3 }} />

            {/* Funds Section */}
            <Box sx={{ display: 'flex', justifyContent: 'center', mb: 2, p: 2 }}>
              <Card sx={{ boxShadow: 3, width: '100%' }}>
                <CardContent>
                  <Typography variant="body2" color="text.secondary">Funds</Typography>
                  <Typography variant="h6" color="primary">5.00 USDT</Typography>
                </CardContent>
              </Card>
            </Box>

            {/* Earnings */}
            <Box sx={{ display: 'grid', gridTemplateColumns: 'repeat(3, 1fr)', gap: 2 }}>
              {['Today\'s Earnings', 'Monthly Income', 'Total Income'].map((label, i) => (
                <Card key={i} sx={{ boxShadow: 3 }}>
                  <CardContent>
                    <Typography variant="body2" color="text.secondary">{label}</Typography>
                    <Typography variant="h6" color="primary">0.00</Typography>
                  </CardContent>
                </Card>
              ))}
            </Box>

            {/* Team Info */}
            <Box sx={{ display: 'grid', gridTemplateColumns: 'repeat(3, 1fr)', gap: 2, mt: 2 }}>
              {['Today\'s Team', 'Team of the month', 'Team Income'].map((label, i) => (
                <Card key={i} sx={{ boxShadow: 3 }}>
                  <CardContent>
                    <Typography variant="body2" color="text.secondary">{label}</Typography>
                    <Typography variant="h6" color="primary">0.00</Typography>
                  </CardContent>
                </Card>
              ))}
            </Box>

            {/* Quantization Notice */}
            <Card sx={{ boxShadow: 3, mt: 3 }}>
              <CardContent sx={{ textAlign: 'center' }}>
                <Typography variant="h6" fontWeight="bold">Quantization's</Typography>
                <Typography variant="body1" sx={{ mt: 1 }}>
                  To start quantization, please fill up your account!
                </Typography>
                <Button
                  variant="contained"
                  color="primary"
                  sx={{ mt: 2 }}
                  onClick={() => navigate('/recharge')}
                >
                  Recharge Now
                </Button>
              </CardContent>
            </Card>

            {/* VIP Section */}
            <Box sx={{ mt: 5, display: 'flex', flexDirection: 'column', alignItems: 'center' }}>
              <Card sx={{ boxShadow: 3, maxWidth: 1000, width: '100%' }}>
                <CardContent>
                  <Typography variant="h5" fontWeight="bold" sx={{ mb: 2 }}>
                    ðŸ”¶ VIP Level
                  </Typography>
                  <Box
                    sx={{
                      display: 'flex',
                      flexWrap: 'wrap',
                      justifyContent: 'left',
                      gap: 2,
                    }}
                  >
                    {['v0', 'v1', 'v2', 'v3', 'v4'].map((level) => (
                      <Box
                        key={level}
                        component="img"
                        src={`/img/${level}.png`}
                        alt={`VIP ${level.toUpperCase()} Card`}
                        sx={{
                          width: { xs: '90px', sm: '130px', md: '140px' },
                          height: 'auto',
                          boxShadow: 3,
                          borderRadius: 2,
                        }}
                      />
                    ))}
                  </Box>

                  <Box sx={{ mt: 3 }}>
                    <Typography variant="subtitle1" fontWeight="bold">
                      VIP0 Upgrade Conditions
                    </Typography>
                    <Typography>Balance: 3 ~ 30 U</Typography>
                  </Box>
                </CardContent>
              </Card>
            </Box>
          </CardContent>
        </Card>
      </div>

      <FooterMenu />
    </div>
  );
};

export default QuantitativeTrading;
